;; **
;;; Define a query
;; **

;; @@
(defn poly [w x]
  (reduce #(-> %1 (* x) (+ %2)) (reverse w)))

(with-primitive-procedures [poly]
  (defquery polynomial-regression [inputs outputs]
    (let [w0 (sample "w0" (laplace 0 3))
          w1 (sample "w1" (laplace 0 3))
          w2 (sample "w2" (laplace 0 3))]
      (map #(observe (student-t 4 (poly [w0 w1 w2] %1) 1) %2) inputs outputs)
      [w0 w1 w2])))
