;; **
;;; ## Inference
;;; 
;;; Generate test outputs from some true weights.
;; **

;; @@
(def w0 1)
(def w1 1)
(def w2 1)
(def test-outputs (mapv #(sample* (laplace (+ w0 (* w1 %) (* w2 % %)) 1)) fixed-inputs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.polynomial-regression/test-outputs</span>","value":"#'worksheets.polynomial-regression/test-outputs"}
;; <=

;; **
;;; First, run the inference server from torch-infcomp:
;;; 
;;; `python -m infcomp.infer`
;;; 
;;; Then run the query, specifying number of particles:
;; **

;; @@
(def num-particles 10)
(def csis-states (take num-particles (infer :csis polynomial-regression [fixed-inputs test-outputs] :tcp-endpoint "tcp://localhost:6666")))
(let [inputs (range -10 10.5 0.5)]
  (compose
    ;; Points
    (list-plot (mapv vector fixed-inputs test-outputs))
    
    ;; Ground truth
    (plot (partial poly [w0 w1 w2]) [-10 10] :color "black")
    
    ;; Posterior
    (apply compose
           (mapv (fn [[[w0 w1 w2] weight]]
                   (plot (partial poly [w0 w1 w1]) [-10 10]
                                :opacity weight
                                :color "blue"
                                :joined true))
                 (vec (empirical-distribution (collect-results csis-states)))))))
